import{_ as e,c as r,o as n,aN as a}from"./chunks/framework.ClnKacJt.js";const x=JSON.parse('{"title":"使用GitHub键盘快捷键汇总","description":"","frontmatter":{"title":"使用GitHub键盘快捷键汇总","date":"2022-07-20T11:24:49.000Z"},"headers":[],"relativePath":"03-github-tips/05-Summary-using-GitHub-keyboard-shortcuts.md","filePath":"03-github-tips/05-Summary-using-GitHub-keyboard-shortcuts.md","lastUpdated":1768579861000}'),l={name:"03-github-tips/05-Summary-using-GitHub-keyboard-shortcuts.md"};function d(i,t,s,c,o,g){return n(),r("div",null,[...t[0]||(t[0]=[a('<h1 id="使用github键盘快捷键汇总" tabindex="-1">使用GitHub键盘快捷键汇总 <a class="header-anchor" href="#使用github键盘快捷键汇总" aria-label="Permalink to &quot;使用GitHub键盘快捷键汇总&quot;">​</a></h1><p>本文源地址：<a href="https://docs.github.com/cn/get-started/using-github/keyboard-shortcuts" target="_blank" rel="noreferrer">https://docs.github.com/cn/get-started/using-github/keyboard-shortcuts</a></p><h1 id="键盘快捷键" tabindex="-1">键盘快捷键 <a class="header-anchor" href="#键盘快捷键" aria-label="Permalink to &quot;键盘快捷键&quot;">​</a></h1><p>几乎 GitHub 上的每一页都有键盘快捷键，可以更快地执行操作。</p><h2 id="关于键盘快捷键" tabindex="-1">关于键盘快捷键 <a class="header-anchor" href="#关于键盘快捷键" aria-label="Permalink to &quot;关于键盘快捷键&quot;">​</a></h2><p>在 GitHub 中输入 ? 可弹出一个对话框，列出可用于该页面的键盘快捷键。 您可以使用这些键盘快捷键对站点执行操作，而无需使用鼠标导航。</p><p>您可以在辅助功能设置中禁用字符键快捷键，同时仍允许使用修饰键的快捷键。 更多信息请参阅“<a href="https://docs.github.com/cn/account-and-profile/setting-up-and-managing-your-personal-account-on-github/managing-personal-account-settings/managing-accessibility-settings" target="_blank" rel="noreferrer">管理辅助功能设置</a>”。</p><p>下面是一些可用键盘快捷键的列表。</p><p>GitHub 命令面板 还可让您快速访问各种操作，而无需记住键盘快捷键。 更多信息请参阅“<a href="https://docs.github.com/cn/get-started/using-github/github-command-palette" target="_blank" rel="noreferrer">GitHub 命令面板</a>”。</p><h2 id="站点快捷键" tabindex="-1">站点快捷键 <a class="header-anchor" href="#站点快捷键" aria-label="Permalink to &quot;站点快捷键&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">S 或 /</td><td style="text-align:center;">聚焦于搜索栏。 更多信息请参阅“<a href="https://docs.github.com/cn/search-github/getting-started-with-searching-on-github/about-searching-on-github" target="_blank" rel="noreferrer">关于在 GitHub 上搜索</a>”。</td></tr><tr><td style="text-align:center;">G N</td><td style="text-align:center;">转到您的通知。 更多信息请参阅“<a href="https://docs.github.com/cn/github/managing-subscriptions-and-notifications-on-github/about-notifications" target="_blank" rel="noreferrer">关于通知</a>”。</td></tr><tr><td style="text-align:center;">Esc</td><td style="text-align:center;">当聚焦于用户、议题或拉取请求悬停卡时，关闭悬停卡并重新聚焦于悬停卡所在的元素</td></tr></tbody></table><p><code>Command+K (Mac)</code> 或 <code>Ctrl+K (Windows/Linux)</code> | 打开 GitHub 命令面板。 如果要编辑 Markdown 文本，请使用 <code>Command+Option+K</code> 或 <code>Ctrl+Alt+K</code>打开命令面板。 更多信息请参阅“<a href="https://docs.github.com/cn/get-started/using-github/github-command-palette" target="_blank" rel="noreferrer">GitHub 命令面板</a>”。</p><h2 id="仓库" tabindex="-1">仓库 <a class="header-anchor" href="#仓库" aria-label="Permalink to &quot;仓库&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">G C</td><td style="text-align:center;">转到 <strong>Code（代码）</strong> 选项卡</td></tr><tr><td style="text-align:center;">G I</td><td style="text-align:center;">转到 <strong>Issues（议题）</strong> 选项卡。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/about-issues" target="_blank" rel="noreferrer">关于议题</a>”。</td></tr><tr><td style="text-align:center;">G P</td><td style="text-align:center;">转到 <strong>Pull requests（拉取请求）</strong> 选项卡。 更多信息请参阅“<a href="https://docs.github.com/cn/pull-requests/collaborating-with-pull-requests/proposing-changes-to-your-work-with-pull-requests/about-pull-requests" target="_blank" rel="noreferrer">关于拉取请求</a>”。</td></tr><tr><td style="text-align:center;">G A</td><td style="text-align:center;">转到 <strong>Actions（操作）</strong> 选项卡。 更多信息请参阅“<a href="https://docs.github.com/cn/actions/getting-started-with-github-actions/about-github-actions" target="_blank" rel="noreferrer">关于 Actions</a>”。</td></tr><tr><td style="text-align:center;">G B</td><td style="text-align:center;">转到 <strong>Projects（项目）</strong> 选项卡。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/about-project-boards" target="_blank" rel="noreferrer">关于项目板</a>”。</td></tr><tr><td style="text-align:center;">G W</td><td style="text-align:center;">转到 <strong>Wiki</strong> 选项卡。 更多信息请参阅“<a href="https://docs.github.com/cn/communities/documenting-your-project-with-wikis/about-wikis" target="_blank" rel="noreferrer">关于 wiki</a>”。</td></tr><tr><td style="text-align:center;">G G</td><td style="text-align:center;">转到 <strong>Discussions（讨论）</strong> 选项卡。 更多信息请参阅“<a href="https://docs.github.com/cn/discussions/collaborating-with-your-community-using-discussions/about-discussions" target="_blank" rel="noreferrer">关于讨论</a>”。</td></tr></tbody></table><h2 id="源代码编辑" tabindex="-1">源代码编辑 <a class="header-anchor" href="#源代码编辑" aria-label="Permalink to &quot;源代码编辑&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">.</td><td style="text-align:center;">在基于 Web 的编辑器中打开存储库或拉取请求。 更多信息请参阅“<a href="https://docs.github.com/cn/codespaces/developing-in-codespaces/web-based-editor" target="_blank" rel="noreferrer">基于 Web 的编辑器</a>”。</td></tr><tr><td style="text-align:center;">Command+B (Mac) 或 Ctrl+B (Windows/Linux)</td><td style="text-align:center;">插入 Markdown 格式用于粗体文本</td></tr><tr><td style="text-align:center;">Command+I (Mac) 或 Ctrl+I (Windows/Linux)</td><td style="text-align:center;">插入 Markdown 格式用于斜体文本</td></tr><tr><td style="text-align:center;">Command+K (Mac) 或 Ctrl+K (Windows/Linux)</td><td style="text-align:center;">插入 Markdown 格式以创建链接</td></tr><tr><td style="text-align:center;">Command+Shift+7 (Mac) 或 Ctrl+Shift+7 (Windows/Linux)</td><td style="text-align:center;">为有序列表插入 Markdown 格式</td></tr><tr><td style="text-align:center;">Command+Shift+8 (Mac) 或 Ctrl+Shift+8 (Windows/Linux)</td><td style="text-align:center;">为无序列表插入 Markdown 格式</td></tr><tr><td style="text-align:center;">Command+Shift+. (Mac) 或 Ctrl+Shift+. (Windows/Linux)</td><td style="text-align:center;">为报价插入 Markdown 格式</td></tr><tr><td style="text-align:center;">E</td><td style="text-align:center;">在 <strong>Edit file（编辑文件）</strong> 选项卡中打开源代码文件</td></tr><tr><td style="text-align:center;">Command+F (Mac) 或 Ctrl+F (Windows/Linux)</td><td style="text-align:center;">开始在文件编辑器中搜索</td></tr><tr><td style="text-align:center;">Command+G (Mac) 或 Ctrl+G (Windows/Linux)</td><td style="text-align:center;">查找下一个</td></tr><tr><td style="text-align:center;">Command+Shift+G (Mac) 或 Ctrl+Shift+G (Windows/Linux)</td><td style="text-align:center;">查找上一个</td></tr><tr><td style="text-align:center;">Command+Option+F (Mac) 或 Ctrl+Shift+F (Windows/Linux)</td><td style="text-align:center;">替换</td></tr><tr><td style="text-align:center;">Command+Shift+Option+F (Mac) 或 Ctrl+Shift+R (Windows/Linux)</td><td style="text-align:center;">全部替换</td></tr><tr><td style="text-align:center;">Alt+G</td><td style="text-align:center;">跳至行</td></tr><tr><td style="text-align:center;">Command+Z (Mac) 或 Ctrl+Z (Windows/Linux)</td><td style="text-align:center;">撤消</td></tr><tr><td style="text-align:center;">Command+Y (Mac) 或 Ctrl+Y (Windows/Linux)</td><td style="text-align:center;">重做</td></tr><tr><td style="text-align:center;">Command+Shift+P</td><td style="text-align:center;">在 <strong>Edit file（编辑文件）</strong> 与 <strong>Preview changes（预览更改）</strong> 选项卡之间切换</td></tr><tr><td style="text-align:center;">Command+S (Mac) 或 Ctrl+S (Windows/Linux)</td><td style="text-align:center;">填写提交消息</td></tr></tbody></table><p>有关更多键盘快捷键，请参阅 <a href="https://codemirror.net/doc/manual.html#commands" target="_blank" rel="noreferrer">CodeMirror 文档</a>。</p><h2 id="源代码浏览" tabindex="-1">源代码浏览 <a class="header-anchor" href="#源代码浏览" aria-label="Permalink to &quot;源代码浏览&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">T</td><td style="text-align:center;">激活文件查找器</td></tr><tr><td style="text-align:center;">L</td><td style="text-align:center;">跳至代码中的某一行</td></tr><tr><td style="text-align:center;">W</td><td style="text-align:center;">切换到新分支或标记</td></tr><tr><td style="text-align:center;">Y</td><td style="text-align:center;">将 URL 展开为其规范形式。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/getting-permanent-links-to-files" target="_blank" rel="noreferrer">获取文件的永久链接</a>”。</td></tr><tr><td style="text-align:center;">I</td><td style="text-align:center;">显示或隐藏有关差异的评论。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/commenting-on-the-diff-of-a-pull-request" target="_blank" rel="noreferrer">评论拉取请求的差异</a>”。</td></tr><tr><td style="text-align:center;">A</td><td style="text-align:center;">在差异上显示或隐藏注释</td></tr><tr><td style="text-align:center;">B</td><td style="text-align:center;">打开追溯视图。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/tracing-changes-in-a-file" target="_blank" rel="noreferrer">跟踪文件中的更改</a>”。</td></tr></tbody></table><h2 id="评论" tabindex="-1">评论 <a class="header-anchor" href="#评论" aria-label="Permalink to &quot;评论&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">Command+B (Mac) 或 Ctrl+B (Windows/Linux)</td><td style="text-align:center;">插入 Markdown 格式用于粗体文本</td></tr><tr><td style="text-align:center;">Command+I (Mac) 或 Ctrl+I (Windows/Linux)</td><td style="text-align:center;">插入 Markdown 格式用于斜体文本</td></tr><tr><td style="text-align:center;">Command+E (Mac) 或 Ctrl+E (Windows/Linux)</td><td style="text-align:center;">在行中插入代码或命令的 Markdown 格式</td></tr><tr><td style="text-align:center;">Command+K (Mac) 或 Ctrl+K (Windows/Linux)</td><td style="text-align:center;">插入用于创建链接的 Markdown 格式</td></tr><tr><td style="text-align:center;">Command+V (Mac) 或 Ctrl+V (Windows/Linux)</td><td style="text-align:center;">在应用于突出显示的文本时创建 Markdown 链接</td></tr><tr><td style="text-align:center;">Command+Shift+P (Mac) 或 Ctrl+Shift+P (Windows/Linux)</td><td style="text-align:center;">在 <strong>Write（撰写）</strong> 和 <strong>Preview（预览）</strong> 评论选项卡之间切换</td></tr><tr><td style="text-align:center;">Command+Shift+V (Mac) 或 Ctrl+Shift+V (Windows/Linux)</td><td style="text-align:center;">将 HTML 链接粘贴为纯文本</td></tr><tr><td style="text-align:center;">Command+Shift+Opt+V (Mac) 或 Ctrl+Shift+Alt+V (Windows/Linux)</td><td style="text-align:center;">将 HTML 链接粘贴为纯文本</td></tr><tr><td style="text-align:center;">Command+Shift+7 (Mac) 或 Ctrl+Shift+7 (Windows/Linux)</td><td style="text-align:center;">为有序列表插入 Markdown 格式</td></tr><tr><td style="text-align:center;">Command+Shift+8 (Mac) 或 Ctrl+Shift+8 (Windows/Linux)</td><td style="text-align:center;">为无序列表插入 Markdown 格式</td></tr><tr><td style="text-align:center;">Command+Enter (Mac) 或 Ctrl+Enter (Windows/Linux)</td><td style="text-align:center;">提交评论</td></tr><tr><td style="text-align:center;">Ctrl+.，然后 Ctrl+[保存的回复编号]</td><td style="text-align:center;">打开已保存回复菜单，然后使用已保存回复自动填写评论字段。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/about-saved-replies" target="_blank" rel="noreferrer">关于已保存回复</a>”。</td></tr><tr><td style="text-align:center;">Command+Shift+. (Mac) 或 Ctrl+Shift+. (Windows/Linux)</td><td style="text-align:center;">为报价插入 Markdown 格式</td></tr><tr><td style="text-align:center;">Command+G (Mac) 或 Ctrl+G (Windows/Linux)</td><td style="text-align:center;">插入建议。 更多信息请参阅“<a href="https://docs.github.com/cn/pull-requests/collaborating-with-pull-requests/reviewing-changes-in-pull-requests/reviewing-proposed-changes-in-a-pull-request" target="_blank" rel="noreferrer">审查拉取请求中提议的更改</a>”。</td></tr><tr><td style="text-align:center;">R</td><td style="text-align:center;">在您的回复中引用所选的文本。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/basic-writing-and-formatting-syntax#quoting-text" target="_blank" rel="noreferrer">基本撰写和格式语法</a>”。</td></tr></tbody></table><h2 id="议题和拉取请求列表" tabindex="-1">议题和拉取请求列表 <a class="header-anchor" href="#议题和拉取请求列表" aria-label="Permalink to &quot;议题和拉取请求列表&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">C</td><td style="text-align:center;">创建议题</td></tr><tr><td style="text-align:center;">Command+/ (Mac) 或 Ctrl+/ (Windows/Linux)</td><td style="text-align:center;">将光标聚焦于议题或拉取请求搜索栏。 更多信息请参阅“<a href="https://docs.github.com/cn/issues/tracking-your-work-with-issues/filtering-and-searching-issues-and-pull-requests" target="_blank" rel="noreferrer">筛选和搜索问题以及拉取请求</a>”。</td></tr><tr><td style="text-align:center;">U</td><td style="text-align:center;">按作者过滤</td></tr><tr><td style="text-align:center;">L</td><td style="text-align:center;">按标签过滤或编辑标签。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/filtering-issues-and-pull-requests-by-labels" target="_blank" rel="noreferrer">按标签过滤议题和拉取请求</a>”。</td></tr><tr><td style="text-align:center;">Alt 并单击</td><td style="text-align:center;">按标签过滤时，排除标签。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/filtering-issues-and-pull-requests-by-labels" target="_blank" rel="noreferrer">按标签过滤议题和拉取请求</a>”。</td></tr><tr><td style="text-align:center;">M</td><td style="text-align:center;">按里程碑过滤或编辑里程碑。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/filtering-issues-and-pull-requests-by-milestone" target="_blank" rel="noreferrer">按里程碑过滤议题和拉取请求</a>”。</td></tr><tr><td style="text-align:center;">A</td><td style="text-align:center;">按受理人过滤或编辑受理人。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/filtering-issues-and-pull-requests-by-assignees" target="_blank" rel="noreferrer">按受理人过滤议题和拉取请求</a>”。</td></tr><tr><td style="text-align:center;">O 或 Enter</td><td style="text-align:center;">打开议题</td></tr></tbody></table><h2 id="议题和拉取请求" tabindex="-1">议题和拉取请求 <a class="header-anchor" href="#议题和拉取请求" aria-label="Permalink to &quot;议题和拉取请求&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">Q</td><td style="text-align:center;">请求审查者。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/requesting-a-pull-request-review" target="_blank" rel="noreferrer">申请拉取请求审查</a>”。</td></tr><tr><td style="text-align:center;">M</td><td style="text-align:center;">设置里程碑。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/associating-milestones-with-issues-and-pull-requests" target="_blank" rel="noreferrer">将里程碑与议题及拉取请求关联</a>”。</td></tr><tr><td style="text-align:center;">L</td><td style="text-align:center;">应用标签。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/applying-labels-to-issues-and-pull-requests" target="_blank" rel="noreferrer">应用标签到议题和拉取请求</a>”。</td></tr><tr><td style="text-align:center;">A</td><td style="text-align:center;">设置受理人。 更多信息请参阅“<a href="https://docs.github.com/cn/articles/assigning-issues-and-pull-requests-to-other-github-users" target="_blank" rel="noreferrer">分配议题和拉取请求到其他 GitHub 用户</a>”。</td></tr><tr><td style="text-align:center;">X</td><td style="text-align:center;">链接来自同一存储库的议题或拉取请求。 更多信息请参阅“<a href="https://docs.github.com/cn/issues/tracking-your-work-with-issues/linking-a-pull-request-to-an-issue" target="_blank" rel="noreferrer">将拉取请求链接到议题</a>”。</td></tr><tr><td style="text-align:center;">Command+Shift+P (Mac) 或 Ctrl+Shift+P (Windows/Linux)</td><td style="text-align:center;">在 <strong>Write（撰写）</strong> 和 <strong>Preview（预览）</strong> 选项卡之间切换</td></tr><tr><td style="text-align:center;">Alt 并单击</td><td style="text-align:center;">从任务列表创建议题时，按住 Alt 并单击任务右上角的 ，在当前选项卡中打开新议题表单。 更多信息请参阅“<a href="https://docs.github.com/cn/issues/tracking-your-work-with-issues/creating-issues/about-task-lists" target="_blank" rel="noreferrer">关于任务列表</a>”。</td></tr><tr><td style="text-align:center;">Shift 并点击</td><td style="text-align:center;">从任务列表创建议题时，按住 Shift 并单击任务右上角的 ，在新选项卡中打开新议题表单。 更多信息请参阅“<a href="https://docs.github.com/cn/issues/tracking-your-work-with-issues/creating-issues/about-task-lists" target="_blank" rel="noreferrer">关于任务列表</a>”。</td></tr><tr><td style="text-align:center;">Command 并点击 (Mac) 或 Ctrl+Shift 并点击 (Windows/Linux)</td><td style="text-align:center;">从任务列表创建议题时，按住 Command 或 Ctrl+Shift 并单击任务右上角的 ，在新窗口中打开新议题表单。 更多信息请参阅“<a href="https://docs.github.com/cn/issues/tracking-your-work-with-issues/creating-issues/about-task-lists" target="_blank" rel="noreferrer">关于任务列表</a>”。</td></tr></tbody></table><h2 id="拉取请求中的更改" tabindex="-1">拉取请求中的更改 <a class="header-anchor" href="#拉取请求中的更改" aria-label="Permalink to &quot;拉取请求中的更改&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">C</td><td style="text-align:center;">在拉取请求中打开提交列表</td></tr><tr><td style="text-align:center;">T</td><td style="text-align:center;">在拉取请求中打开已更改文件列表</td></tr><tr><td style="text-align:center;">J</td><td style="text-align:center;">将所选内容在列表中向下移动</td></tr><tr><td style="text-align:center;">K</td><td style="text-align:center;">将所选内容在列表中向上移动</td></tr><tr><td style="text-align:center;">Command+Shift+Enter</td><td style="text-align:center;">添加一条有关拉取请求差异的评论</td></tr><tr><td style="text-align:center;">Alt 并单击</td><td style="text-align:center;">通过按下 Alt 并单击 <strong>Show outdated（显示已过期）</strong> 或 <strong>Hide outdated（隐藏已过期）</strong>，在折叠和展开拉取请求中所有过期的审查评论之间切换。</td></tr><tr><td style="text-align:center;">单击，然后按住 Shift 并单击</td><td style="text-align:center;">单击一个行号，按住 Shift，然后单击另一行号，便可对拉取请求的多行发表评论。 更多信息请参阅“<a href="https://docs.github.com/cn/github/collaborating-with-issues-and-pull-requests/commenting-on-a-pull-request#adding-line-comments-to-a-pull-request" target="_blank" rel="noreferrer">评论拉取请求</a>”。</td></tr></tbody></table><h2 id="项目板" tabindex="-1">项目板 <a class="header-anchor" href="#项目板" aria-label="Permalink to &quot;项目板&quot;">​</a></h2><h3 id="移动列" tabindex="-1">移动列 <a class="header-anchor" href="#移动列" aria-label="Permalink to &quot;移动列&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">Enter 或 Space</td><td style="text-align:center;">开始移动聚焦的列</td></tr><tr><td style="text-align:center;">Esc</td><td style="text-align:center;">取消正在进行的移动</td></tr><tr><td style="text-align:center;">Enter</td><td style="text-align:center;">完成正在进行的移动</td></tr><tr><td style="text-align:center;">← 或 H</td><td style="text-align:center;">向左移动列</td></tr><tr><td style="text-align:center;">Command+← 或 Command+H (Mac) 或 Ctrl+← 或 Ctrl+H (Windows/Linux)</td><td style="text-align:center;">将列移动到最左侧的位置</td></tr><tr><td style="text-align:center;">→ 或 L</td><td style="text-align:center;">向右移动列</td></tr><tr><td style="text-align:center;">Command+→ 或 Command+L (Mac) 或 Ctrl+→ 或 Ctrl+L (Windows/Linux)</td><td style="text-align:center;">将列移动到最右侧的位置</td></tr></tbody></table><h3 id="移动卡片" tabindex="-1">移动卡片 <a class="header-anchor" href="#移动卡片" aria-label="Permalink to &quot;移动卡片&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">Enter 或 Space</td><td style="text-align:center;">开始移动聚焦的卡片</td></tr><tr><td style="text-align:center;">Esc</td><td style="text-align:center;">取消正在进行的移动</td></tr><tr><td style="text-align:center;">Enter</td><td style="text-align:center;">完成正在进行的移动</td></tr><tr><td style="text-align:center;">↓ 或 J</td><td style="text-align:center;">向下移动卡片</td></tr><tr><td style="text-align:center;">Command+↓ 或 Command+J (Mac) 或 Ctrl+↓ 或 Ctrl+J (Windows/Linux)</td><td style="text-align:center;">将卡片移动到该列的底部</td></tr><tr><td style="text-align:center;">↑ 或 K</td><td style="text-align:center;">向上移动卡片</td></tr><tr><td style="text-align:center;">Command+↑ 或 Command+K (Mac) 或 Ctrl+↑ 或 Ctrl+K (Windows/Linux)</td><td style="text-align:center;">将卡片移动到该列的顶部</td></tr><tr><td style="text-align:center;">← 或 H</td><td style="text-align:center;">将卡片移动到左侧列的底部</td></tr><tr><td style="text-align:center;">Shift+← 或 Shift+H</td><td style="text-align:center;">将卡片移动到左侧列的顶部</td></tr><tr><td style="text-align:center;">Command+← 或 Command+H (Mac) 或 Ctrl+← 或 Ctrl+H (Windows/Linux)</td><td style="text-align:center;">将卡片移动到最左侧列的底部</td></tr><tr><td style="text-align:center;">Command+Shift+← 或 Command+Shift+H (Mac) 或 Ctrl+Shift+← 或 Ctrl+Shift+H (Windows/Linux)</td><td style="text-align:center;">将卡片移动到最左侧列的顶部</td></tr><tr><td style="text-align:center;">→</td><td style="text-align:center;">将卡片移动到右侧列的底部</td></tr><tr><td style="text-align:center;">Shift+→ 或 Shift+L</td><td style="text-align:center;">将卡片移动到右侧列的顶部</td></tr><tr><td style="text-align:center;">Command+→ 或 Command+L (Mac) 或 Ctrl+→ 或 Ctrl+L (Windows/Linux)</td><td style="text-align:center;">将卡片移动到最右侧列的底部</td></tr><tr><td style="text-align:center;">Command+Shift+→ 或 Command+Shift+L (Mac) 或 Ctrl+Shift+→ 或 Ctrl+Shift+L (Windows/Linux)</td><td style="text-align:center;">将卡片移动到最右侧列的底部</td></tr></tbody></table><h3 id="预览卡片" tabindex="-1">预览卡片 <a class="header-anchor" href="#预览卡片" aria-label="Permalink to &quot;预览卡片&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">Esc</td><td style="text-align:center;">关闭卡片预览窗格</td></tr></tbody></table><h2 id="github-actions" tabindex="-1">GitHub Actions <a class="header-anchor" href="#github-actions" aria-label="Permalink to &quot;GitHub Actions&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">Command+Space (Mac) 或 Ctrl+Space (Windows/Linux)</td><td style="text-align:center;">在工作流程编辑器中，获取对工作流程文件的建议。</td></tr><tr><td style="text-align:center;">G F</td><td style="text-align:center;">转到工作流程文件</td></tr><tr><td style="text-align:center;">Shift+T 或 T</td><td style="text-align:center;">切换日志中的时间戳</td></tr><tr><td style="text-align:center;">Shift+F 或 F</td><td style="text-align:center;">切换全屏日志</td></tr><tr><td style="text-align:center;">Esc</td><td style="text-align:center;">退出全屏日志</td></tr></tbody></table><h2 id="通知" tabindex="-1">通知 <a class="header-anchor" href="#通知" aria-label="Permalink to &quot;通知&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">E</td><td style="text-align:center;">标记为完成</td></tr><tr><td style="text-align:center;">Shift+U</td><td style="text-align:center;">标记为未读</td></tr><tr><td style="text-align:center;">Shift+I</td><td style="text-align:center;">标记为已读</td></tr><tr><td style="text-align:center;">Shift+M</td><td style="text-align:center;">取消订阅</td></tr></tbody></table><h2 id="网络图" tabindex="-1">网络图 <a class="header-anchor" href="#网络图" aria-label="Permalink to &quot;网络图&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">键盘快捷键</th><th style="text-align:center;">描述</th></tr></thead><tbody><tr><td style="text-align:center;">← 或 H</td><td style="text-align:center;">向左滚动</td></tr><tr><td style="text-align:center;">→ 或 L</td><td style="text-align:center;">向右滚动</td></tr><tr><td style="text-align:center;">↑ 或 K</td><td style="text-align:center;">向上滚动</td></tr><tr><td style="text-align:center;">↓ 或 J</td><td style="text-align:center;">向下滚动</td></tr><tr><td style="text-align:center;">Shift+← (Mac) 或 Shift+H (Windows/Linux)</td><td style="text-align:center;">一直向左滚动</td></tr><tr><td style="text-align:center;">Shift+→ (Mac) 或 Shift+L (Windows/Linux)</td><td style="text-align:center;">一直向右滚动</td></tr><tr><td style="text-align:center;">Shift+↑ (Mac) 或 Shift+K (Windows/Linux)</td><td style="text-align:center;">一直向上滚动</td></tr><tr><td style="text-align:center;">Shift+↓ (Mac) 或 Shift+J (Windows/Linux)</td><td style="text-align:center;">一直向下滚动</td></tr></tbody></table>',40)])])}const y=e(l,[["render",d]]);export{x as __pageData,y as default};
